import React from 'react';

export const Card = ({ listOfItems })=> {
    return(
        <>
            { listOfItems.map(item => {
                return(
                    <ul key={item.id}>
                        <li>
                            {item.name}
                        </li>
                    </ul>
                )
            })}
        </>    
    )
}
